import React from "react";
import HeaderLogedin from "../components/headerLogedin";
import { Box, Paper } from "@mui/material";
import Grid from "@mui/material/Grid";

export default function Profile(params) {
  return (
    <>
      <HeaderLogedin />

      <Paper sx={{ marginBlock: "100px", padding: "60px" }} elevation={2}>
        <Grid sx={{ height: "600px" }} container spacing={2}>
          <Grid item xs={6} md={8}>
            <Box sx={{ height: "100%" }}>xs=6 md=8</Box>
          </Grid>
          <Grid item xs={6} md={4}>
            <Box>xs=6 md=4</Box>
          </Grid>
        </Grid>
      </Paper>
    </>
  );
}
